// this line should not be removed
var wEmpCarousel = angular.module( "wEmpCarouselTesting",[]);

wEmpCarousel.controller( "wEmpCarouselTestingController", function( $scope ) {
    $scope.power={};
	var dq = new DataQuery( 'qGetCarouselItems' );
	dq.execute().
	done( function() {
		$scope.$apply(function() {
			$scope.results = dq.getData().data;
		});
	});
$scope.pass=function (dsds){
    console.log(dsds);
    $scope.$apply(function() {
    $scope.info=$scope.results[dsds.carouselIndex];
    });
};
});
